  "id_str" : "285607889794646016",
  "text" : "\uB530\uB77C\uC11C \uC545\uBC95\uB3C4 \uBC95\uC774\uB77C\uB294 \uC0AC\uB840\uB97C \uC900\uBC95\uC815\uC2E0\uACFC \uC5F0\uACB0\uC2DC\uD0A4\uB294 \uAC83\uC740 \uC801\uC808\uCE58 \uC54A\uB2E4.\" (3\/3) \uACE0\uB85C, '\uB108 \uC18C\uD06C\uB77C\uD14C\uC2A4\uB77C\uACE0 \uC544\uB0D0? \uADF8 \uC18C\uD06C\uB77C\uD14C\uC2A4\uAC00 \uB9D0\uC774\uC9C0..' \uD558\uBA74\uC11C '\uC545\uBC95\uB3C4 \uBC95\uC774\uB2E4' \uB77C\uB294 \uD5C8\uAD6C\uC758 \uAC1C\uB150\uC744 \uC790\uC2E0\uC758 \uBED8\uB4DC\uB9BD\uC758 \uC7AC\uB8CC\uB85C \uC0AC\uC6A9\uD558\uC9C0 \uC54A\uC558\uC73C\uBA74 \uC88B\uACA0\uC2B5\uB2C8\uB2E4.",
