  "id_str" : "285607469827379200",
  "text" : "\uACFC\uAC70 \uAD8C\uC704\uC8FC\uC758\uC815\uAD8C \uB54C\uB294 \uD5CC\uBC95\uC744 \uC5EC\uB7EC\uAC00\uC9C0 \uBC95 \uC911 \uD558\uB098\uB85C \uB300\uC811\uD588\uACE0 \u2018\uAD6D\uBBFC\uC758 \uAE30\uBCF8\uAD8C\u2019\uC744 \uACF5\uB3D9\uCCB4\uB97C \uC704\uD574 \uC591\uBCF4\uD574\uC57C \uD560 \uB300\uC0C1\uC73C\uB85C \uCDE8\uAE09\uD588\uB2E4. \uC774 \uB54C\uBB38\uC5D0 \uAD50\uC721\uC774 \uAD8C\uC704\uC8FC\uC758 \uC815\uAD8C\uC744 \uC815\uB2F9\uD654\uD558\uB294 \uC218\uB2E8\uC73C\uB85C \uC804\uB77D\uD558\uBA74\uC11C \uC900\uBC95\uC815\uC2E0\uC774 \uC798\uBABB \uAE30\uC220\uB418\uACE0 \uAC15\uC870\uB410\uB2E4. (2\/3)",
