  "id_str" : "285607350662987776",
  "text" : "\uD5CC\uBC95\uC7AC\uD310\uC18C\uAC00 '\uC545\uBC95\uB3C4 \uBC95\uC774\uB2E4'\uB97C \uAD50\uACFC\uC11C\uC5D0\uC11C \uC0AD\uC81C\uD560 \uAC83\uC744 \uAD50\uACFC\uBD80\uC5D0 \uC694\uCCAD\uD55C \uC774\uC720\uB294 \uB2E4\uC74C\uACFC \uAC19\uC2B5\uB2C8\uB2E4. \"\uC2E4\uC9C8\uC801 \uBC95\uCE58\uC8FC\uC758\uC640 \uC801\uBC95\uC808\uCC28\uAC00 \uAC15\uC870\uB418\uB294 \uC624\uB298\uB0A0\uC758 \uD5CC\uBC95\uCCB4\uACC4\uC5D0\uC11C\uB294 \uC900\uBC95\uC774\uB780 \uC815\uB2F9\uD55C \uBC95, \uC815\uB2F9\uD55C \uBC95\uC9D1\uD589\uC744 \uC804\uC81C\uB85C \uD55C\uB2E4. (1\/3)",
