  "geo" : { },
  "id_str" : "285607310607388673",
  "text" : "\uCC38\uACE0\uB85C \uD5CC\uBC95\uC7AC\uD310\uC18C\uB294 \uC9C0\uB09C 2004\uB144, \"'\uC545\uBC95\uB3C4 \uBC95\u2019\uC774\uB77C\uBA70 \uB3C5\uBC30\uB97C \uB9C8\uC168\uB2E4\uB294 \uC18C\uD06C\uB77C\uD14C\uC2A4\uC758 \uC77C\uD654\uB97C \uC900\uBC95\uC815\uC2E0 \uAC15\uC870\uB97C \uC704\uD55C \uC0AC\uB840\uB85C \uC0AC\uC6A9\uD558\uB294 \uAC83\uC740 \uBC14\uB78C\uC9C1\uD558\uC9C0 \uC54A\uB2E4.\"\uBA70 \uAD50\uACFC\uC11C\uC5D0\uC11C \uC774\uB97C \uC0AD\uC81C\uD560 \uAC83\uC744 \uAD50\uC721\uBD80\uC5D0 \uC694\uCCAD\uD55C \uC801\uC774 \uC788\uC8E0.",
