  "geo" : { },
  "id_str" : "285607226381578242",
  "text" : "\uC5EC\uD2BC.. \uC81C\uAC00 \uD558\uACE0 \uC2F6\uC740 \uB9D0\uC740- \uC545\uBC95\uC740 \uC22D\uBC30\uC640 \uC2E0\uB8B0, \uBCF5\uC885\uC758 \uB300\uC0C1\uC774 \uC544\uB2C8\uB77C, \uADF9\uBCF5\uACFC \uAC1C\uC120, \uC800\uD56D\uC758 \uB300\uC0C1\uC77C \uBFD0\uC785\uB2C8\uB2E4. '\uC545\uBC95\uB3C4 \uBC95\uC774\uB2E4'\uB97C \uAD00\uCCA0\uC2DC\uD0A4\uB824 \uD55C\uB2E4\uBA74, \uD5CC\uBC95\uC7AC\uD310\uC18C\uC758 \uC704\uD5CC\uBC95\uB960\uC2EC\uD310\uC81C\uB3C4\uB098 \uD5CC\uBC95\uC18C\uC6D0\uC81C\uB3C4\uB97C \uC124\uBA85\uD560 \uC218 \uC5C6\uB2E4\uB294 \uB51C\uB808\uB9C8\uC5D0 \uBE60\uC9C0\uAC8C \uB418\uACA0\uC8E0.",
