  "text" : "\uC774 \"quod quidem perquam durum est, sed ita lex scripta est\"\uC5D0\uC11C \"dura lex, sed lex (\uC545\uBC95\uB3C4 \uBC95\uC774\uB2E4)\"\uAC00 \uBC1C\uCDCC\uB418\uC5C8\uB2E4\uACE0 \uD569\uB2C8\uB2E4. (Bujuklic, Z.) \uC9C0\uAE08\uAE4C\uC9C0 \uC54C\uB824\uC9C4 \uBC14\uB85C\uB294 \uC774\uAC8C \uAC00\uC7A5 \uD655\uC2E4",
