  "text" : "\uC774 \uB9D0\uC758 \uC5B4\uC6D0\uC744 \uCC3E\uC544\uBCF4\uC790\uBA74, \uC11C\uAE30 2\uC138\uAE30 \uACBD \uB85C\uB9C8\uC758 \uBC95\uB960\uAC00 \uB3C4\uBBF8\uB204\uC2A4 \uC6B8\uD53C\uC544\uB204\uC2A4(Dominus Ulpianus)\uAC00 \uADF8\uC758 \uC800\uC220\uC9D1\uC5D0\uC11C \"quod quidem perquam durum est, sed ita lex scripta est\"\uB77C\uACE0 \uC4F4 \uC801\uC774 \uC788\uACE0",
