  "text" : "\uC624\uB2E4\uCE74 \uB3C4\uBAA8\uC624\uB294 \uC77C\uBCF8\uC758 \uD55C\uAD6D \uC9C0\uBC30\uB97C \uC815\uB2F9\uD654\uD558\uACE0 \uC9D5\uBCD1\uC5D0 \uCC2C\uC131\uD558\uB294 \uB17C\uBB38\uC744 \uBC1C\uD45C\uD55C '\uBC18\uBBFC\uC8FC\uC801\u00B7\uC2DD\uBBFC\uC8FC\uC758\uC801 \uD30C\uC1FC\uC0AC\uC0C1'\uC744 \uAC00\uC9C4 \uC778\uBB3C\uC774\uC5C8\uC8E0. \uADF8\uB9AC\uACE0 \uADF8\uC5D0\uAC8C\uC11C \uBC95\uD559\uC744 \uBC30\uC6B4 \uD55C\uAD6D \uBC95\uD559\uC790\uB4E4\uC774 \uADF8 \uB5A1\uBC25\uC744 \uC815\uB9AC\uD558\uC5EC '\uC545\uBC95\uB3C4 \uBC95\uC774\uB2E4' \uB77C\uB294 \uC2E0\uC870\uC5B4(?)\uB97C \uCC3D\uC870\uD574\uB0B4\uAC8C \uB429\uB2C8\uB2E4.",
