  "text" : "\uC5EC\uD2BC, \uC774 \uC124\uBA85\uC774 \uB9D8\uC5D0 \uC548\uB4DC\uC2DC\uB294 \uBD84\uB4E4\uAED8 '\uB10C \uC288\u3163\uBC1C, \uBC95\uB960\uAC00\uB85C\uC11C\uC758 \uC778\uC131\uC774 \uBD80\uC871\uD574. \uC5B4\uB9B0\uB188\uC774\uB77C \uC138\uC0C1\uC744 \uBAB0\uB77C. \uACF5\uBD80 \uD5DB\uD588\uC5B4. \uBC95\uACF5\uBD80 \uCC98\uC74C\uBD80\uD130 \uB2E4\uC2DC \uD574\uC640 \uC0C8\uCEAC' \uC758 \uC218\uC900\uC5D0\uC11C \uBC97\uC5B4\uB098\uC9C0 \uC54A\uC744- \uCC3D\uC758\uB825\uC774 \uBD80\uC871\uD55C \uB4DC\uB9BD\uC744 \uAE30\uB300\uD558\uACE0 \uC788\uACA0\uC2B5\uB2C8\uB2E4. \uC544.. \uC124\uB808\uC778\uB2E4",
