  "text" : "\uBB50.. \uC81C\uAC00 \uC774\uB7F0 \uB9D0\uC744 \uD574\uBD24\uC790 '\uD5CC\uC7AC\uAC00 \uACFD\uAD50\uC721\uAC10\uC744 \uC5FF\uBA39\uC600\uAE30 \uB54C\uBB38\uC5D0 \uD5CC\uC7AC\uB97C \uAE4C\uC57C\uB9CC \uD560 \uAC83 \uAC19\uACE0, \uB0A8\uB4E4\uC774 \uAD00\uC2B5\uBC95 \uAD00\uC2B5\uBC95 \uD558\uB2C8\uAE4C \uADF8\uB7FC \uB098\uB3C4 \uBB54\uC9C4 \uBAA8\uB974\uC9C0\uB9CC \uB2E5\uCE58\uACE0 \uAD00\uC2B5\uBC95 \uC8E0\uAE4C!!' \uB77C\uACE0 \uC0DD\uAC01\uD558\uC2DC\uB294 \uBD84\uB4E4\uAED8\uC11C\uB294 \uC804\uD600 \uAD00\uC2EC\uB3C4 \uC548\uAC00\uC9C0\uC2E4\uAC81\uB2C8\uB2E4. \uB124\uB124 \uADF8\uB7FC\uC694.",
