  "id_str" : "284647761180258304",
  "text" : "\uBB3C\uB860 \uAD00\uC2B5\uD5CC\uBC95\uC774 \uBC18\uB4DC\uC2DC \uC131\uBB38\uD5CC\uBC95\uACFC \uB3D9\uC77C\uD55C \uAC1C\uC815\uC808\uCC28(\uB300\uD55C\uBBFC\uAD6D \uD5CC\uBC95 \uC81C130\uC870: \uAD6D\uD68C\uC758\uACB0+\uAD6D\uBBFC\uD22C\uD45C)\uB97C \uAC70\uCCD0\uC57C\uB9CC \uAC1C\uC815\uC774 \uAC00\uB2A5\uD55C \uAC83\uC740 \uC544\uB2D9\uB2C8\uB2E4. \uB300\uB2E4\uC218\uC758 \uAD6D\uBBFC\uB4E4\uC774 \uAE30\uC874\uC5D0 \uC874\uC7AC\uD558\uB358 \uD5CC\uBC95\uC801 \uAD00\uC2B5\uC758 \uD6A8\uB825\uC744 \uBD80\uC815\uD55C\uB2E4\uBA74, \uAE30\uC874\uC758 \uAD00\uC2B5\uD5CC\uBC95\uC740 \uD6A8\uB825\uC744 \uC783\uACE0 \uC0AC\uB77C\uC9C0\uAC8C \uB418\uC8E0",
