  "id_str" : "284647527746269185",
  "text" : "\uB9CC\uC57D\uC5D0 \uB204\uAD70\uAC00\uAC00 '\uC560\uAD6D\uAC00\uAC00 \uC2EB\uB2E4, \uAD6D\uAC00\uB97C \uBC14\uAFB8\uC790' \uB77C\uACE0 \uD55C\uB2E4\uAC70\uB098, '\uD0DC\uADF9\uAE30 \uBCF4\uAE30 \uC2EB\uB2E4, \uAD6D\uAE30\uB97C \uBC14\uAFB8\uC790'.\uB77C\uACE0 \uD55C\uB2E4\uBA74 \uC774\uB294 \uAD00\uC2B5\uD5CC\uBC95\uC5D0 \uB300\uD55C \uBD80\uC815\uC774 \uB418\uACA0\uC8E0. \uB530\uB77C\uC11C \uB300\uD55C\uBBFC\uAD6D\uC758 \uAD6D\uAE30\uB098 \uAD6D\uAC00, \uAD6D\uC5B4\uB97C \uBC14\uAFB8\uB824\uBA74 \uC131\uBB38\uD5CC\uBC95\uC758 \uAC1C\uC815\uACFC \uB3D9\uC77C\uD55C \uC808\uCC28\uB97C \uBC1F\uC544\uC57C \uD569\uB2C8\uB2E4.",
