  "id_str" : "284647337362608129",
  "text" : "\uC774\uCC98\uB7FC \uD5CC\uBC95\uC5D0 \uADDC\uC815\uB418\uC5B4 \uC788\uC9C0\uB294 \uC54A\uC9C0\uB9CC, \uAD6D\uAC00\uC758 \uBCF8\uC9C8\uC801\uC778 \uC0AC\uD56D\uC774 \uC624\uB79C \uC138\uC6D4 \uB3D9\uC548 \uC9C0\uC18D\uC801\uC774\uACE0 \uBC18\uBCF5\uC801\uC774\uBA70 \uBA85\uD655\uD55C \uAD00\uD589\uC73C\uB85C \uC874\uC7AC\uD558\uACE0, \uC774\uB7EC\uD55C \uAD00\uD589\uC774 \uAD6D\uBBFC\uB4E4\uC5D0\uAC8C \uD3ED\uB113\uC740 \uD569\uC758\uB97C \uC5BB\uAC8C \uB418\uC5B4 \uD558\uB098\uC758 \uD5CC\uBC95\uC801 \uADDC\uBC94\uC73C\uB85C\uC11C \uC791\uC6A9\uD558\uAC8C \uB418\uB294 \uAC83\uC744 '\uAD00\uC2B5\uD5CC\uBC95'\uC774\uB77C\uACE0 \uD569\uB2C8\uB2E4.",
