  "id_str" : "284647120080891905",
  "text" : "\uADF8\uB7FC \uC131\uBB38\uC758 \uD5CC\uBC95\uC804\uC744 \uAC00\uC9C4 \uC131\uBB38\uD5CC\uBC95\uAD6D\uAC00\uC778 \uB300\uD55C\uBBFC\uAD6D\uC740 \uAD00\uC2B5\uD5CC\uBC95\uC774 \uBD88\uD544\uC694\uD558\uB2E4\uACE0 \uC0DD\uAC01\uD558\uC2E4\uC218\uB3C4 \uC788\uB294\uB370\uC694, \uAC00\uBCBC\uC6B4 \uC608\uB97C \uD558\uB098 \uB4E4\uC8E0. \uB300\uD55C\uBBFC\uAD6D\uC758 \uAD6D\uAC00\uB294 \uC560\uAD6D\uAC00\uC774\uACE0, \uAD6D\uAE30\uB294 \uD0DC\uADF9\uAE30\uC774\uBA70, \uAD6D\uC5B4\uB294 \uD55C\uAD6D\uC5B4\uC774\uC8E0. \uC774 \uBAA8\uB4E0 \uAC83\uC774 \uAD6D\uAC00 \uC815\uCCB4\uC131\uC774\uB098 \uC0C1\uC9D5\uC131\uACFC \uAD00\uB828\uB41C \uB0B4\uC6A9\uC785\uB2C8\uB2E4.",
