  "id_str" : "284646965571092480",
  "text" : "\uBB3C\uB860 \uC601\uAD6D\uC5D0\uB3C4 \uC131\uBB38\uC73C\uB85C \uB41C \uD5CC\uBC95\uC0AC\uD56D\uC774 \uC788\uAE30\uB294 \uD569\uB2C8\uB2E4\uB9CC, \uADF8\uAC83\uC740 \uADFC\uB798\uC5D0 \uB4E4\uC5B4 \uC5B4\uB5A0\uD55C \uC815\uCE58\uC801\u00B7\uC0AC\uD68C\uC801 \uD544\uC694\uC5D0 \uC758\uD574 \uC131\uBB38\uC73C\uB85C \uAE30\uB85D\uB418\uAE30 \uC2DC\uC791\uD55C \uAC83\uC77C \uBFD0- \uAE30\uBCF8 \uBCA0\uC774\uC2A4\uB294 \uAD00\uC2B5\uD5CC\uBC95\uC73C\uB85C \uAD6C\uC131\uB41C \uD5CC\uBC95\uAD6D\uAC00\uC785\uB2C8\uB2E4. \uADF8\uB807\uB2E4\uACE0 \uC601\uAD6D\uC774 \uD6C4\uC9C4\uAD6D\uC778 \uAC83\uC740 \uC808\uB300(!!) \uC544\uB2C8\uC8E0.",
