  "id_str" : "284646831739252738",
  "text" : "\uADF8\uB807\uB2E4\uBA74, \uC131\uBB38\uC758 \uD5CC\uBC95\uC804\uC774 \uC5C6\uB294 \uC601\uAD6D\uC5D0\uC11C\uB294 \uBB34\uC5C7\uC774 \uD5CC\uBC95\uC774 \uB420\uAE4C\uC694? \uBC14\uB85C \uAD00\uC2B5\uD5CC\uBC95(Constitutional conventions, \uD5CC\uBC95\uC801 \uAD00\uB840)\uC774 \uC131\uBB38\uC758 \uD5CC\uBC95\uC804\uC744 \uB300\uC2E0\uD569\uB2C8\uB2E4. \uC989, \uC601\uAD6D\uC740 \uAD00\uC2B5\uD5CC\uBC95\uC73C\uB85C \uB41C \uD5CC\uBC95\uC744 \uAC00\uC9C0\uACE0 \uC788\uB294 \uB098\uB77C\uC785\uB2C8\uB2E4.",
