  "id_str" : "284646266363858946",
  "text" : "\uC804\uC138\uACC4 \uAC70\uC758 \uBAA8\uB4E0 \uAD6D\uAC00\uB4E4\uC774 \uC131\uBB38(\uBB38\uC790\uB85C \uC50C\uC5B4\uC9C4)\uD5CC\uBC95\uC804\uC744 \uAC00\uC9C0\uACE0 \uC788\uC9C0\uB9CC, \uC774\uB7EC\uD55C \uC131\uBB38 \uD5CC\uBC95\uC804\uC774 \uC5C6\uB294 \uAD6D\uAC00\uAC00 \uB531 \uC138 \uACF3 \uC788\uC2B5\uB2C8\uB2E4. \uC601\uAD6D, \uB274\uC9C8\uB79C\uB4DC, \uADF8\uB9AC\uACE0 \uC774\uC2A4\uB77C\uC5D8\uC774\uC8E0. \uC774 \uC138 \uB098\uB77C\uB294 \uBB38\uC790\uB85C \uAE30\uB85D\uB41C \uD5CC\uBC95\uC804\uC774 \uC5C6\uAE30 \uB54C\uBB38\uC5D0 \uBD88\uBB38\uD5CC\uBC95\uAD6D\uAC00\uB85C \uBD88\uB9BD\uB2C8\uB2E4.",
