  "id_str" : "284646002063982594",
  "text" : "\uD5CC\uBC95\uC774\uB780 \uAD6D\uAC00\uC758 \uAE30\uBCF8\uBC95\uCE59\uC73C\uB85C\uC11C, \uAD6D\uBBFC\uC758 \uAE30\uBCF8\uC801 \uC778\uAD8C\uC744 \uBCF4\uC7A5\uD558\uACE0 \uAD6D\uAC00\uC758 \uC815\uCE58\uC870\uC9C1\uC758 \uAD6C\uC131\uACFC \uC815\uCE58 \uC791\uC6A9\uC758 \uC6D0\uCE59\uC744 \uC815\uD558\uACE0 \uC2DC\uBBFC\uACFC \uAD6D\uAC00\uC758 \uAD00\uACC4\uB97C \uADDC\uC815\uD558\uAC70\uB098 \uD615\uC131\uD558\uB294 \uCD5C\uACE0\uC758 \uADDC\uBC94\uC744 \uB9D0\uD569\uB2C8\uB2E4. \uADF8\uB807\uAE30 \uB54C\uBB38\uC5D0 \uD5CC\uBC95\uC774 \uC5C6\uB294 \uAD6D\uAC00\uB294 \uC874\uC7AC\uD558\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4.",
