  "text" : "\uC6B0\uC120, \uC0DD\uAC01\uBCF4\uB2E4 \uB9CE\uC740 \uBD84\uB4E4\uC774 '\uAD00\uC2B5\uD5CC\uBC95\uC774\uB780 \uB178\uBB34\uD604 \uB300\uD1B5\uB839\uC758 \uC218\uB3C4\uC774\uC804 \uACC4\uD68D\uC744 \uB9C9\uAE30 \uC704\uD574 \uB300\uD55C\uBBFC\uAD6D \uD5CC\uBC95\uC7AC\uD310\uC18C\uC5D0\uC11C \uAE09\uC870\uD574\uB0B8 \uC5B5\uC9C0\uC774\uB2E4'\uB77C\uACE0 \uC798\uBABB \uC54C\uACE0 \uACC4\uC2DC\uB294\uB370\uC694, \uAD00\uC2B5\uD5CC\uBC95\uC740 \uC6D0\uB798\uBD80\uD130 \uC874\uC7AC\uD558\uACE0 \uC788\uB358 \uAC1C\uB150- \uC544\uB2C8 \uD5CC\uBC95\uC785\uB2C8\uB2E4.",
