  "text" : "\uC624\uB298\uC740 \uC5B4\uC81C \uD5CC\uBC95\uC7AC\uD310\uC18C\uC758 \uC0AC\uD6C4\uB9E4\uC218\uC8C4 \uAD00\uB828 \uD310\uACB0\uC774 \uB098\uC624\uBA74\uC11C, \uADF8 \uD310\uACB0\uC774 \uC660\uC9C0 \uB9D8\uC5D0 \uB4E4\uC9C0 \uC54A\uC558\uB358 \uBD84\uB4E4\uC5D0 \uC758\uD574 \uD5CC\uAE4C\uC804\uC6A9\uBCD1\uAE30\uB85C \uC4F0\uC774\uACE0 \uC788\uB294 \uAD00\uC2B5\uD5CC\uBC95\uC5D0 \uB300\uD574 \uB9D0\uD574\uBCF4\uB3C4\uB85D \uD558\uC8E0.",
