  "text" : "\uADFC\uB370 \uC0DD\uAC01\uD574\uBCF4\uB2C8 \uAC54\uAC00 \uB098\uBCF4\uB2E4 \uB450\uC0B4\uC774 \uB9CE\uC740 \uB204\uB098\uB124.. \uADFC\uB370 \uCCAB\uB9CC\uB0A8\uC774 \uADF8\uB807\uAC8C \uD30C\uACA9\uC801\uC774\uC5C8\uC5B4\uC11C \uADF8\uB7F0\uC9C0 \uC9C0\uAE08\uAE4C\uC9C0\uB3C4 \uB204\uB098\uB77C\uACE0 \uC0DD\uAC01 \uC548\uD558\uACE0 \uB300\uD568\u314B\u314B\u314B\u314B\u314B \uC220\uB9CC \uB9C8\uC2DC\uBA74 \uC804\uD654\uD574\uC11C \uB0A0 \uCC3E\uB294 \uC774\uC544\uAC00\uC528\uC57C. \uBC24\uC774\uB098 \uC544\uCE68\uC5D0 \uB108\uD55C\uD14C \uC804\uD654\uC624\uBA74 \uC59C \uB610 \uC5B4\uB518\uAC00 \uC2F6\uC5B4 \uB35C\uCEE5\uD574\u314B\u314B\u314B\u314B",
