  "text" : "1\uBC88 \uC548\uCC0D\uC740 49% \uC804\uBD80\uB97C \uB2D8\uB4E4\uD558\uACE0 \uB611\uAC19\uB2E4\uACE0 \uCC29\uAC01\uD558\uC9C0 \uB9D0\uC544\uC694. \uD2B8\uC704\uD130\uC5D0\uC11C \uBED8\uC18C\uB9AC\uB098 \uC9C0\uAEC4\uC774\uBA70 1\uBC88 \uC544\uC6C3\uC744 \uC678\uCE58\uB358 \uC18C\uC218\uC758 \uD788\uD0A4\uCF54\uBAA8\uB9AC\uB4E4 \uC8FC\uC7A5\uC5D4 \uC804\uD600 \uACF5\uAC10 \uC548\uAC00\uACE0 \uADF8\uC800 \uBCD1\uC2E0\uAC19\uB2E4\uACE0 \uC0DD\uAC01\uD558\uC9C0\uB9CC, \uADF8\uB798\uB3C4 1\uBC88\uC774 \uC2EB\uC5B4\uC11C 1\uBC88\uC5D0 \uD45C \uC548\uC900 \uC0AC\uB78C\uB4E4\uC774 49%\uC758 \uB300\uB2E4\uC218\uC77C\uAEC4\uC694",
