  "text" : "\uC5B4\uCC28\uD53C \uB3C8 \uBAA8\uC744\uAEBC\uBA74 \uCC28\uB77C\uB9AC \uC8FD\uC5B4\uB77C \uBAA8\uC544\uC11C SBS\uBBF8\uB514\uC5B4\uD640\uB529\uC2A4\uB098 \uBB50 YTN \uC774\uB7F0\uB370 \uC8FC\uC2DD\uC744 \uB178\uB9AC\uC2DC\uB358\uAC00\uC694. \uAD6D\uBBFCTV\uB97C \uB9CC\uB4E4\uBA74 \uC5EC\uB7EC\uBD84\uC774 \uB9D0\uD558\uB294 '\uBB58 \uBAA8\uB974\uB294 \uC0AC\uB78C\uB4E4'\uC774 \uADF8\uAC78 \uBCF4\uACE0  '\uAE68\uC2DC\uBBFC'\uC774\uB780\uAC8C \uB420\uAEBC\uB77C \uC0DD\uAC01\uD558\uC2DC\uB098\uBCF8\uB370, \uB2E4\uB4E4 \uC815\uB9D0 \uB300\uCC45\uC5C6\uC774 \uAE0D\uC815\uC801 \uB9C8\uC778\uB4DC\uC2DC\uB124..",
