  "text" : "\uC790\uAFB8 \uB300\uC548 \uBBF8\uB514\uC5B4\uAC00 \uC5B4\uCA4C\uACE0 \uC800\uCA4C\uACE0 \uD604\uC2E4\uB3C4\uD53C\uB9CC \uD558\uC9C0 \uB9D0\uACE0, \uD604\uC2E4\uACFC \uC880 \uB9C8\uC8FC\uD574\uBD10\uC694. \uB300\uC548\uBBF8\uB514\uC5B4 \uB9CC\uB4E4\uC5B4\uBD24\uC790 \uADF8\uAC70 \uBCF4\uB294 \uC0AC\uB78C\uC740 \uB2D8\uB4E4\uBC16\uC5D0 \uC5C6\uC744\uD150\uB370, \uC2DC\uACE8\uC5D0\uC11C \uACF5\uB3D9\uCCB4 \uACF5\uC9C0\uBC29\uC1A1\uD558\uB294 \uADF8\uB7F0 \uC218\uC900\uC774\uC796\uC544\uC694. \uADF8\uAC74 \uC0C1\uCC98\uC785\uC740 \uAC1C\uB4E4\uC774 \uC11C\uB85C \uC0C1\uCC98 \uD565\uC544\uC8FC\uB294 \uAF34\uB85C \uC804\uB77D\uD558\uB294 \uAC70\uC5D0\uC694.",
