  "text" : "\uAD6D\uBBFC 1\uC778\uB2F9 \uC57D 0.5\uC6D0\uC758 \uBE44\uC6A9 \uC9C0\uCD9C\uB85C \uD749\uC545\uBC94\uC744 \uC0AC\uD68C\uC5D0\uC11C \uC601\uAD6C\uD788 \uACA9\uB9AC\uC2DC\uD0AC \uC218 \uC788\uB2E4\uBA74 \uADF8\uB2E4\uC9C0 \uC544\uAE4C\uC6B8 \uAC83 \uAC19\uC9C0\uB294 \uC54A\uC740\uB370, \uADF8\uB9C8\uC800\uB3C4 \uC544\uAE4C\uC6B0\uC2DC\uB2E4\uBA74 \uD560 \uB9D0 \uC5C6\uAD6C\uC694. \uADFC\uB370, \uC0AC\uD615\uC9D1\uD589\uC5D0 \uCC38\uC5EC\uD55C \uAD50\uB3C4\uAD00\uB4E4\uC758 \uC815\uC2E0\uC801 \uCDA9\uACA9 \uC7AC\uD65C\uC5D0 \uB4E4\uC5B4\uAC00\uB294 \uBE44\uC6A9\uC740 \uC5BC\uB9C8\uC778\uC9C0 \uC798 \uBAA8\uB974\uACA0\uC2B5\uB2C8\uB2E4",
