  "text" : "\uB204\uAC00 \uADF8\uB7AC\uB354\uB77C...\n\n\uC608\uC804\uC5D0 \uB204\uAD70\uAC00\uAC00 '\uC557\uC2F8 \uBD09\uC7A1\uC558\uB2E4..!' \uD588\uB294\uB370, \uADF8 \uBD09\uC758 \uCE5C\uAD6C\uAC00 '\uC5B4? \uB098 \uC598 \uC5B4\uB514\uC11C \uBCF8 \uC801 \uC788\uB294\uB370... \uC7A0\uAE50\uB9CC. \uB538\uAE4D\uB538\uAE4D\uB538\uAE4D. \uBD10\uBD10, \uB9DE\uC9C0?? \uD5D0, \uADFC\uB370 \uC606\uC5D0 \uB204\uC6CC\uC788\uB294 \uC59C \uB204\uAD6C\uB0E8\u314B\u314B\u314B\u314B\u314B\u314B\u314B\u314B\u314B\u314B\u314B'",
