  "text" : "\uACF5\uAC1C\uB85C \uC778\uD55C \uCD95\uBCF5\uB3C4 \uC88B\uC9C0\uB9CC, \uB54C\uB85C\uB294 \uD604\uBA85\uD558\uAC8C \uAD74\uC5B4\uC57C \uD560 \uB54C\uAC00 \uB9CE\uC2B5\uB514\uB2E4. \uAC1C\uC778\uC801\uC73C\uB85C\uB294 \uC5F0\uC560\uC0AC\uC2E4\uC758 \uACF5\uAC1C\uB098, \uB514\uD14C\uC77C\uD55C \uC804\uAD6D\uBC29\uC1A1\uC740 \uAC00\uB2A5\uD55C \uD53C\uD558\uB294 \uD3B8.",
