  "text" : "\uC6B0\uB9AC \uB098\uB77C\uC758 \uD5CC\uBC95\uC9C8\uC11C \uC544\uB798\uC5D0\uC11C\uB294 \uD5CC\uBC95\uC5D0 \uC815\uD55C \uBBFC\uC8FC\uC801 \uC808\uCC28\uC5D0 \uC758\uD558\uC9C0 \uC544\uB2C8\uD558\uACE0 \uD3ED\uB825\uC5D0 \uC758\uD558\uC5EC \uD5CC\uBC95\uAE30\uAD00\uC758 \uAD8C\uB2A5\uD589\uC0AC\uB97C \uBD88\uAC00\uB2A5\uD558\uAC8C \uD558\uAC70\uB098 \uC815\uAD8C\uC744 \uC7A5\uC545\uD558\uB294 \uD589\uC704\uB294 \uC5B4\uB5A0\uD55C \uACBD\uC6B0\uC5D0\uB3C4 \uC6A9\uC778\uB420 \uC218 \uC5C6\uB2E4. \uB530\uB77C\uC11C \uADF8 \uAD70\uC0AC\uBC18\uB780\uACFC \uB0B4\uB780\uD589\uC704\uB294 \uCC98\uBC8C\uC758 \uB300\uC0C1\uC774 \uB41C\uB2E4. (4\/14)",
