  "text" : "\uC5EC\uD2BC, \uBC18\uB300\uB97C \uC704\uD55C \uBC18\uB300\uB97C \uD574\uBD24\uC790 \uBCF8\uC778\uC758 \uC815\uC2E0\uBD84\uC5F4\uC99D\uC138\uB9CC \uAC00\uC18D\uD654 \uB420 \uBFD0\uC785\uB2C8\uB2E4. \uC778\uC815\uD560\uAC74 \uC778\uC815\uD558\uACE0, \uBC1F\uC544\uC57C \uD560 \uC21C\uC11C\uB294 \uBC1F\uC544\uB098\uAC00\uC57C\uC8E0. \uB300\uD55C\uBBFC\uAD6D \uC0AC\uBC95\uBD80\uAC00 \uADF8\uC815\uB3C4\uB85C \uB9D0\uB791\uB9D0\uB791\uD558\uC9C4 \uC54A\uC544\uC694. \uBB3C\uB860 UN\uB2D8 \uC5ED\uC2DC \uBCD1\uC2E0\uC9D3\uC5D0 \uD558\uB098\uD558\uB098 \uBC18\uC751\uD574 \uC8FC\uC2E4 \uC815\uB3C4\uB85C \uD55C\uAC00\uD558\uC9C0 \uC54A\uAD6C\uC694.",
