  "text" : "\uD558\uC9C0\uB9CC \uD734\uB9AC\uCCBC.H \uC639\uAED8\uC11C\uB294 \uC120\uAC70\uAC10\uC2DC\uB2E8\uC744 \uBCF4\uB0B4\uB2EC\uB77C\uB294 \uB5BC\uBA58\uC158(\uADF8\uAC83\uB3C4 \uD55C\uAE00\uB85C!!)\uC6B4\uB3D9\uC744 \uBC8C\uC600\uC74C\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 UN \uC815\uBB34\uAD6D\uC5D0\uC11C \uC774\uB97C \uAC00\uBCCD\uAC8C \uC539\uC5B4\uC8FC\uC2DC\uC790 'UN\uC740 \uBBFF\uC744 \uC218\uAC00 \uC5C6\uB2E4. \uAC15\uC790\uB17C\uB9AC\uAC00 \uC5B4\uCA4C\uACE0, \uD55C\uD328\uAC70\uB9AC\uAC00 \uC800\uCA4C\uACE0..' \uD558\uB294 \uC815\uC2E0\uC2B9\uB9AC\uB97C \uBCF4\uC5EC\uC8FC\uC168\uC2B5\uB2C8\uB2E4.",
