  "text" : "\uC18C\uC124 '\uB4DC\uB798\uACE4 \uB77C\uC790'\uC758 \uC8FC\uC694 \uB4F1\uC7A5\uC778\uBB3C \uC911 \uD558\uB098\uC778 \uB125\uC2A8 \uD734\uB9AC\uCCBC\uC740 \uC0AC\uC2E4 \uC804\uD615\uC801\uC778 \uC815\uC2E0\uBD84\uC5F4\uC99D \uD658\uC790\uB85C \uB098\uC635\uB2C8\uB2E4. \uB9DD\uC0C1\uC99D\uB3C4 \uC2EC\uD558\uACE0, \uC790\uC2E0\uC758 \uBAA9\uC801 \uB2EC\uC131\uC744 \uC704\uD574\uC11C\uB294 \uC77C\uAD6D\uC744 \uC804\uBCF5\uC2DC\uD0A4\uB824 \uD558\uAC70\uB098 \uAE38\uAC00\uC758 \uC544\uC774\uB9C8\uC800 \uC9D3\uBC1F\uC544 \uC8FD\uC774\uB294 \uB4F1\uC758 \uAE30\uC774\uD55C \uD589\uB3D9\uC744 \uD558\uAE30\uB3C4 \uD558\uACE0",
