  "text" : "\uC5CA\uADF8\uC81C\uC600\uB098.. \uC800\uD55C\uD14C\uB294 \uB300\uB738 \uBA58\uC158\uC744 \uB0A0\uB824 \uC2DC\uBE44\uB97C \uAC78\uACE0 \uBB50\uB77C\uACE0 \uC3FC\uB77C\uC3FC\uB77C \uD558\uACE0, \uADF8\uB9AC\uACE0\uB294 \uB610 \uB2E4\uB978\uB370 \uAC00\uC11C \uC3FC\uB77C\uC3FC\uB77C \uD558\uB2E4\uAC00 \uAC70\uAE30\uC11C \uC548\uD1B5\uD558\uB2C8\uAE4C \uAC70\uAE30\uB2E4\uAC00 \uB610 \uB108\uB2D8\uC5D0\uAC8C\uB3C4 \uCC45\uC784\uC774 \uC788\uB124 \uC5B4\uCA4C\uACE0 \uC800\uCA4C\uACE0 \uD654\uD480\uC774\uB97C \uD558\uB354\uB77C\uAD6C\uC694. \uC815\uB9D0\uC774\uC9C0 '\uAD11\uAE30'\uAC00 \uB290\uAEF4\uC9C0\uB354\uB77C\uB294..",
