  "text" : "\uBCF8\uC778 \uB9D0\uB85C\uB294 \uC9D1\uC548\uC5D0\uC11C\uB3C4 \uBBF8\uCE58\uAD11\uC774 \uCDE8\uAE09 \uBC1B\uACE0, \uBB50 \uC0DD\uD65C\uC774 \uD30C\uD0C4\uC774 \uB0AC\uB124 \uBB50 \uC5B4\uCA4C\uACE0 \uC800\uCA4C\uACE0 \uD558\uB358\uB370.. \uADF8\uAC70 \uAC00\uC871\uB4E4\uC774 \uC815\uB9D0 \uC798\uBABB\uD55C\uAC81\uB2C8\uB2E4. \uB9E4\uC77C \uC9C0\uCF1C\uBCF4\uBA74\uC11C \uC65C \uAC00\uB9CC\uD788 \uB194\uB450\uC5C8\uB098\uC694. \uCD08\uAE30\uBD80\uD130 \uAFB8\uC900\uD788 \uCE58\uB8CC\uB97C \uC2DC\uCF30\uC73C\uBA74 \uADF8\uC815\uB3C4\uAE4C\uC9C0 \uC815\uC2E0\uBD84\uC5F4\uC774 \uC9C4\uD589\uB418\uC9C4 \uC54A\uC558\uC744\uD150\uB370 \uB9D0\uC774\uC5D0\uC694",
