  "text" : "\uADF8\uB798\uC11C UN \uC815\uBB34\uAD6D(DPA) \uACF5\uC2DD\uACC4\uC815\uC5D0 \uB5BC\uBA58\uC158 \uB0A0\uB9AC\uAE30 \uC6B4\uB3D9\uC744 \uD558\uC168\uB354\uAD70\uC694. \uACB0\uACFC\uC57C \uBD88\uC744 \uBCF4\uB4EF \uBED4\uD558\uC8E0- \uAC4D \uC539\uD799\uB2C8\uB2E4. \uADF8\uB7AC\uB354\uB2C8 \uC774\uBC88\uC5D4 UN\uC744 \uBABB\uBBFF\uACA0\uB300\uC694. \uBB50 \uBB34\uC2A8 \uB5BC\uC4F0\uB294 \uC544\uC774\uB3C4 \uC544\uB2C8\uACE0.. \uB2E4\uC74C\uC5D4 \uC5B4\uB514\uC5D0 \uB5BC\uBA58\uC158 \uB0A0\uB9AC\uC2E4\uB798\uC694? \uC774\uBC88\uC5D4 \uC608\uC218\uB2D8\uBD07\uC5D0 \uD574\uBCF4\uC2DC\uC8E0.",
