  "text" : "\uBBF8\uB300\uC0AC\uAD00\uC774~ \uBBF8\uB300\uC0AC\uAD00\uC774~ \uD558\uC2DC\uB294 \uBD84\uB4E4\uC740 \uB9CE\uC740\uB370, \uC815\uC791 \uCD9C\uCC98\uB97C \uBC1D\uD788\uB294 \uBD84\uB4E4\uC740 \uD55C\uBC88\uB3C4 \uBABB\uBD24\uB124\uC694. \uADF8\uB0E5 \uB9C9 \uB358\uC838\uB3C4 \uB418\uB294\uAC70\uB77C\uBA74 \uC800\uB3C4 \uD55C\uBC88 \uB358\uC838\uBCFC\uB78D\uB2C8\uB2E4. \uBAB0\uB85C\uC2DC\uC544\uACF5\uD654\uAD6D \uB300\uC0AC\uAD00\uC774 \uC120\uAC70 \uC9C1\uD6C4 \uBD80\uBAA8\uAD50 \uAD50\uC8FC\uB2D8\uC778 \uBC15\uAD11\uC218\uC528\uC758 99% \uB4DD\uD45C \uB2F9\uC120\uC744 \uC608\uC0C1\uD558\uACE0 \uC774\uB97C \uBCF8\uAD6D\uC5D0 \uC804\uB2EC",
