  "text" : "\uC81C\uC77C \uC6C3\uACBC\uB358 \uAC83\uC911 \uD558\uB098\uB294 \uC790\uAE30 \uD2B8\uC704\uD130\uC5D0\uB2E4\uAC00 \uB098\uB97C \uACA8\uB0E5\uD574\uC11C \uADF8 \uCE5C\uAD6C\uB294 \uC544\uC9C1 \uC5B4\uB824\uC11C \uC138\uC0C1\uC774 \uC5B4\uCA4C\uACE0 \uC800\uCA4C\uACE0 \uD558\uB294 \uBA58\uC158\uC744 \uB0A8\uAE34 \uC0AC\uB78C\uC774\uC5C8\uB2E4. \uC57C, \uB2CC \uADF8\uB798\uB193\uACE0 \uBC15\uADFC\uD61C\uC640 \uC774\uBA85\uBC15\uC744 \uC8E4\uD2B8 \uAE4C\uACE0 \uC788\uB354\uB77C. \uBC15\uADFC\uD61C\uC640 \uC774\uBA85\uBC15\uC774 \uB108\uBCF4\uB2E4 \uB098\uC774 \uB354 \uBA39\uC5C8\uC5B4, \uADF8\uB2C8\uAE4C \uB10C \uCA14\uC838 \u314B\u314B",
