  "text" : "\uC5EC\uD2BC, \uB09C \uC624\uB298 \uC0AC\uB78C\uC774 \uC5BC\uB9C8\uB098 \uCD94\uC7A1\uD574\uC9C8 \uC218 \uC788\uB294\uC9C0\uB97C \uBAA9\uB3C4\uD588\uB2E4. \uCD94\uC7A1\uD558\uB2E4\uB294 \uB9D0 \uC678\uC5D0\uB294 \uBB50\uB77C \uD45C\uD604\uD560 \uBC29\uBC95\uC774 \uC5C6\uB124. \uB300\uB738 \uC30D\uC695\uC9C8\uC744 \uD558\uC9C8 \uC54A\uB098, \uB2C8\uAC00 \uB098\uBCF4\uB2E4 \uC5B4\uB824\uBCF4\uC774\uB2C8\uAE4C \uB0B4\uAC00 \uC633\uB2E4\uC9C8 \uC54A\uB098, \uB534 \uBD84\uC5D0\uAC8C \uAC00\uC11C \uC695\uD558\uB2E4\uAC00 \uADF8\uBD84\uC774 \uC790\uAE30\uD3B8 \uC548\uB4E4\uC5B4 \uC900\uB2E4\uACE0 \uC2F8\uC7A1\uC9C8 \uC54A\uB0B0\u314B\u314B",
