  "text" : "\uC720\uC2E0\uD5CC\uBC95\uACFC 3\uC120\uAC1C\uD5CC\uC774 \uBB54\uC9C0\uB3C4 \uC798 \uBAA8\uB984\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 \uB9CE\uC740 20\uB300\uC758 \uC80A\uC740\uC774\uB4E4\uC774 \uC774\uBC88 \uB300\uC120\uC5D0\uC11C 2\uBC88\uC744 \uC120\uD0DD\uD588\uC2B5\uB2C8\uB2E4. \uC774\uAC78 \uCE6D\uCC2C\uD574\uC8FC\uC9C0\uB294 \uBABB\uD560 \uB9DD\uC815, 20\uB300\uAC00 \uC5B4\uCA4C\uACE0 \uC800\uCA4C\uACE0.. \uC528\uBC1C -_-",
