  "text" : "20\uB300\uAC00 \uC5B4\uCA4C\uACE0 \uC800\uCA4C\uACE0 \uC695\uD558\uC9C0 \uB9C8\uC138\uC694. \uC9C0\uAE08\uC758 20\uB300\uB294 \uBC1C\uCDCC\uAC1C\uD5CC\uC774 \uBB54\uC9C0, \uC0AC\uC0AC\uC624\uC785\uAC1C\uD5CC\uC774 \uBB54\uC9C0, 4.19\uAC00 \uBB54\uC9C0, 5.16\uC774 \uBB54\uC9C0, 3\uC120\uAC1C\uD5CC\uACFC \uC720\uC2E0\uD5CC\uBC95, \uADF8\uB9AC\uACE0 12.12\uAC00 \uBB54\uC9C0 \uC81C\uB300\uB85C \uBC30\uC6B8 \uAE30\uD68C\uC870\uCC28 \uC5C6\uC5C8\uB358 \uC138\uB300\uB4E4\uC774\uC5D0\uC694.",
