  "text" : "\uC6B0\uB9AC\uAC00 \uC9C0\uAE08 \uC815\uB9D0\uB85C \uD574\uC57C \uD560 \uC77C\uB4E4 \uC911 \uD558\uB098\uB294 '\uC81C\uB300\uB85C \uB41C \uB300\uD55C\uBBFC\uAD6D \uD5CC\uC815\uC0AC \uAD50\uC721'\uC785\uB2C8\uB2E4. \uB9CE\uC740 \uAD6D\uBBFC\uB4E4\uC774 '\uC5B4\uB290 \uB300\uD1B5\uB839\uC774 \uC5B4\uB5A4 \uC0AC\uACE0\uB97C \uCCE4\uACE0, \uC5B4\uB5BB\uAC8C \uB3C5\uC7AC\uB97C \uD588\uC73C\uBA70, \uC5B4\uB5BB\uAC8C \uB05D\uC774 \uB0AC\uB294\uAC00'\uB97C \uBAA8\uB974\uACE0 \uC788\uC73C\uB2C8 \uC774\uB7F0 \uACB0\uACFC\uAC00 \uB098\uC624\uB294\uAC70 \uC544\uB2D9\uB2C8\uAE4C.",
