  "text" : "\uADF8\uB7EC\uB2C8\uAE4C \uC815\uB9D0\uB85C \uC218\uAC1C\uD45C\uAC00 \uD558\uACE0 \uC2F6\uC73C\uC2DC\uB2E4\uBA74 \uC544\uBB34\uB7F0 \uD6A8\uB825\uB3C4 \uC5C6\uB294 \uC544\uACE0\uB77C \uCCAD\uC6D0 \uB530\uC704 \uD558\uC9C0 \uB9C8\uC2DC\uACE0, \uC120\uAC70\uC778\uB2E8\uC744 \uBAA8\uC9D1\uD574\uC11C 2013.1.17 (\uBAA9)\uAE4C\uC9C0 \uB2F9\uD574 \uC120\uAC70\uAD6C\uC120\uAC70\uAD00\uB9AC\uC704\uC6D0\uD68C\uC704\uC6D0\uC7A5\uC744 \uD53C\uACE0\uB85C \uD558\uC5EC \uB300\uBC95\uC6D0\uC5D0 \uC120\uAC70\uC18C\uC1A1\uC744 \uC81C\uAE30\uD558\uC138\uC694. \uC544\uACE0\uB77C \uCCAD\uC6D0\uC740 \uB300\uCCB4 \uC65C\uD558\uB294\uAC70\uC57C..",
