  "id_str" : "282753997872459776",
  "text" : "\uC218\uAC1C\uD45C\uAC00 \uBCF8\uAC1C\uD45C\uAC00 \uC5B4\uCA4C\uACE0 \uC218\uAC1C\uD45C \uC548\uD558\uBA74 \uB2F9\uC120 \uBB34\uD6A8\uAC00 \uC800\uCA4C\uAD6C \uB530\uC704\uC758 \uB9D0\uB3C4 \uC548\uB418\uB294 \uC720\uC5B8\uBE44\uC5B4\uB97C \uD37C\uD2B8\uB824\uBD24\uC790 \uC790\uAE30 \uC5BC\uAD74\uC5D0 \uCE68\uBC49\uAE30\uC5D0\uC694. \uC81C\uAC00 \uB9CC\uC57D \uAF34\uBCF4\uC218\uB17C\uAC1D\uC774\uC5C8\uB2E4\uBA74, \uD5C8\uC704\uAE00\uC5D0 \uB09A\uC778 \uC9C0\uAE08 \uD2B8\uC704\uD130\uC758 \uBAA8\uC2B5\uC744 \uC81C\uC2DC\uD558\uBA70 '\uC774 \uBCD1\uC2E0\uB4E4\uC880 \uBD10\uB794\u314B\u314B' \uC774\uB77C\uACE0 \uBE44\uC6C3\uC5C8\uC744 \uAC81\uB2C8\uB2E4.",
