  "text" : "\uB2E4\uC2DC \uD55C\uBC88 \uB9D0\uC500\uB4DC\uB9AC\uC9C0\uB9CC, \uC218\uAC1C\uD45C \uB4F1\uC744 \uD1B5\uD55C \uC7AC\uAC80\uD45C\uC758 \uC694\uAD6C\uAC00 \uC798\uBABB\uB418\uC5C8\uB2E4\uB294 \uAC83\uC774 \uC808\uB300 \uC544\uB2D9\uB2C8\uB2E4. \uB2E4\uB9CC, '\uC218\uAC1C\uD45C=\uBCF8\uAC1C\uD45C' \uB530\uC704\uC758 \uD5C8\uC704\uAE00\uC5D0 \uD639\uC138\uBB34\uBBFC \uB418\uC2DC\uAC70\uB098 \uC544\uBB34\uB7F0 \uBC95\uC801 \uD6A8\uB825\uC870\uCC28 \uC5C6\uB294 \uC544\uACE0\uB77C \uCCAD\uC6D0 \uB530\uC704\uB85C \uC2A4\uC2A4\uB85C\uB97C \uC6B0\uC2A4\uAC2F\uAC70\uB9AC\uB85C \uC804\uB77D\uC2DC\uD0A4\uC9C0 \uB9C8\uC2DC\uB780 \uC774\uC57C\uAE41\uB2C8\uB2E4.",
