  "text" : "\uD574\uB2F9 \uAE00\uC744 \uC5BC\uD54F \uBD10\uC11C\uB294 \uB9C8\uCE58 \uD574\uB2F9 \uBC95\uC870\uBB38\uC744 \uC81C\uC2DC\uD55C \uAC83\uCC98\uB7FC \uBCF4\uC774\uAE30\uB294 \uD574\uC694. \uD558\uC9C0\uB9CC \uC790\uC138\uD788 \uC77D\uC5B4\uBCF4\uBA74 \uBC95\uC870\uBB38\uC774 \uC544\uB2C8\uB77C '\uB204\uAC00 ~\uB77C\uACE0 \uD588\uB2E4\uB354\uB77C' \uB77C\uB294 \uB17C\uD3C9\uC9D1\uC785\uB2C8\uB2E4. \uC81C\uBAA9\uB9CC \uBCF4\uACE0 \uD37C\uB098\uB974\uB294 \uBD84\uB4E4\uC744 \uD639\uC138\uBB34\uBBFC\uD558\uAE30 \uB531 \uC88B\uC740 \uAD6C\uC870\uC8E0.",
