  "text" : "\uADF8\uB7EC\uC790 Bush\uB294 \uD50C\uB85C\uB9AC\uB2E4\uC8FC \uB300\uBC95\uC6D0\uC758 \uD310\uACB0\uC5D0 \uBD88\uBCF5, \uBBF8 \uC5F0\uBC29\uB300\uBC95\uC6D0\uC5D0 \uD574\uB2F9 \uD310\uACB0\uC5D0 \uB300\uD55C \uAE34\uAE09\uC0C1\uACE0\uB97C \uC81C\uAE30\uD558\uC600\uACE0, \uBBF8\uC5F0\uBC29\uB300\uBC95\uC6D0\uC740 \uC218\uAC80\uD45C \uC808\uCC28\uC758 \uC9C4\uD589\uC744 \uC815\uC9C0\uC2DC\uD0B4\uACFC \uB3D9\uC2DC\uC5D0 \uD50C\uB85C\uB9AC\uB2E4\uC8FC \uB300\uBC95\uC6D0\uC758 \uD310\uACB0\uC744 \uD30C\uAE30 \uD658\uC1A1\uD558\uB294 \uD310\uACB0(Bush v. Gore)\uC744 \uB0B4\uB9BD\uB2C8\uB2E4.",
