  "text" : "\uC815\uB9D0\uB85C \uD574\uB2F9 \uC120\uAC70\uC758 \uAC1C\uD45C \uC808\uCC28\uC5D0 \uD558\uC790\uAC00 \uC788\uB2E4\uACE0 \uC0DD\uAC01\uB418\uC2DC\uBA74, \uCC0C\uC9C8\uD558\uAC8C \uC544\uACE0\uB77C\uC5D0 \uC218\uAC1C\uD45C \uCCAD\uC6D0\uB530\uC704 \uD558\uC9C0 \uB9C8\uC2DC\uACE0, \uC120\uAC70\uC77C\uBD80\uD130 30\uC77C \uC774\uB0B4\uC5D0 \uD574\uB2F9 \uC120\uAC70\uAD6C\uC120\uAC70\uAD00\uB9AC\uC704\uC6D0\uD68C\uC704\uC6D0\uC7A5\uC744 \uD53C\uACE0\uB85C \uD558\uC5EC \uB300\uBC95\uC6D0\uC5D0 \uC120\uAC70\uC18C\uC1A1\uC744 \uC81C\uAE30\uD558\uC2DC\uC8E0 (\uACF5\uC9C1\uC120\uAC70\uBC95 \uC81C222\uC870\uC81C1\uD56D)",
