  "text" : "\uC624\uB9C8\uC774\uB274\uC2A4\uAC00 \uAD6D\uC815\uC6D0 \uC9C1\uC6D0\uC774 \uC591\uC2EC\uC120\uC5B8\uC744 \uD588\uB2E4\uB294 \uBCF4\uB3C4\uB97C \uD588\uC9C0\uB9CC, \uD574\uB2F9 \uC81C\uBCF4\uC790 \uBCF8\uC778\uC774 \uC2A4\uC2A4\uB85C \uC2E0\uBD84\uC744 \uBC1D\uD78C \uB4A4 \uC99D\uAC70\uB97C \uBCF4\uC5EC\uC8FC\uACE0, \uD0C0 \uC5B8\uB860\uC0AC\uB4E4\uC5D0\uC11C\uB3C4 \uC0AC\uC2E4\uD655\uC778\uC744 \uD558\uAE30 \uC804\uAE4C\uC9C0\uB294 \uD329\uD2B8\uAC00 \uC544\uB2C8\uC5D0\uC694. \uC774\uBC88 \uBFD0\uB9CC\uC774 \uC544\uB2C8\uB77C \uB2E4\uB978 \uACBD\uC6B0\uC5D0\uB3C4-",
